κἀγὼ γὰρ, ὃς τὰ δείν’ ἐκαρτέρουν τότε, βαφῇ σίδηρος ὣς, ἐθηλύνθην στόμα πρὸς τῆςδε τῆς γυναικός· οἰκτείρω δέ νιν χήραν παρ’ ἐχθροῖς, παῖδά τ’ ὀρφανὸν ἀλλ’ εἶμι πρός τε λουτρὰ καὶ παρακτίους λειμῶνας, ὡς ἂν λύμαθ’ ἁγνίσας ἐμὰ μῆνιν βαρεῖαν ἐξαλεύσωμαι θεᾶς· μολών τε, χῶρον ἔνθ’ ἂν ἀστιβῆ κίχω, κρύψω τόδ’ ἔγχος τοὐμὸν, ἔχθιστον βελῶν, γαίας ὀρύξας ἔνθα μή τις ὄψεται. ἀλλ’ αὐτὸ νὺξ Ἅιδης τε σωζόντων κάτω. ἐγὼ γὰρ ἐξ οὖ χειρὶ τοῦτ’ ἐδεξάμην παρ’ Ἕκτορος δώρημα δυςμενεστάτου, οὔπώ τι κεδνὸν ἔσχον Ἀργείων πάρα. ἀλλ’ ἔστ’ ἀληθὴς ἡ βροτῶν παροιμία, ἐχθρῶν ἄδωρα δῶρα κοὐκ ὀνήσιμα. τοιγὰρ τὸ λοιπὸν εἰσόμεσθα μὲν θεοῖς εἴκειν, μαθησόμεσθα δ’ Ἀτρείδας σέβειν. ἄρχοντές εἰσιν, ὥςθ’ ὑπεικτέον· τί μή ; καὶ γὰρ τὰ δεινὰ καὶ τὰ καρτερώτατα τιμαῖς ὑπείκει· τοῦτο μὲν νιφοστιβεῖς χειμῶνες ἐχωροῦσιν εὐκάρπῳ θέρει· ἐξίσταται δὲ νυκτὸς αἰανῆς κύκλος τῇ λευκοπώλῳ φέγγος ἡμέρῃ φλέγειν. δεινῶν τ’ ἄημα πνευμάτων ἐκοίμισε στένοντα πόντον· ἐν δ’ ὁ παγκρατὴς ὕπνος λύει πεδήσας οὐδ’ ἀεὶ λαβὼν ἔχει. ἡμεῖς δὲ πῶς οὐ γνωσόμεσθα σωφρονεῖν; ἐγὼ δ’, ἐπίσταμαι γὰρ ἀρτίως ὅτι ὅ τ’ ἐχθρὸς ἡμῖν ἐς τοσόνδ’ ἐχθαρτέος, καὶ φιλήσων αὖθις· ἔς τὸν φίλον τοσαῦθ’ ὑπουργῶν ὠφελεῖν βουλήσομαι.

